import React from 'react'
import detailsData from "./TableData"

function Details() {
  return (
    <div>
      <p>{detailsData.fname}</p>
      <p>{detailsData.lname}</p>
      <p>{detailsData.ak}</p>
      <p>{detailsData.age}</p>
    </div>
  )
}

export default Details
